INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("お！\nあそこに困ってそうな人発見！", 1, 1001, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1.4, "春咲 ひより", 0, 0, 2, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("大切な人を\n守れるようになりたい…って", 1, 1002, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1.4, "草野 優衣", 0, 0, 2, 1, "みんなみたいに\nわたしも強くならなきゃ", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("キミに必要な集中力と感性が", 1, 1003, 1, 0, "少しは磨かれると思いますよ。", 0, 1.4, "士条 怜", 0, 0, 2, 1, "フェンシングを始めてみては？", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("今日はなにして遊ぶ？", 1, 1004, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1.5, "穂高 みそぎ", 0, 0, 2, 1, "ねぇ、にいちゃん！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ねぇ…", 1, 1006, 1, 0, "私といっしょに…\nいかない？", 0, 1.4, "風宮 あかり", 0, 0, 2, 1, "風宮あかりです", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("プリンたべたいのー", 1, 1007, 1, 0, "食べ物の恨みは怖いのー", 0, 1.5, "出雲 宮子", 0, 0, 2, 1, "出雲宮子なのー", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("キミもボクの美貌に\n吸い寄せられたんだね。", 1, 1008, 1, 0, "いいよ。\n見られることは運命さ…", 0, 1.4, "虹村 雪", 0, 0, 2, 1, "ボクは虹村雪。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 1009, 1, 0, "人呼んで「疾風の冥姫」!!", 0, 1.4, "柊杏奈", 0, 0, 2, 1, "フッ…聞いて後悔するがいい！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 1010, 1, 0, "ほんまおおきにやわ～♪", 0, 1.5, "姫宮 真歩", 0, 0, 2, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("生き別れたお兄ちゃんを探して\n三千世界！", 1, 1011, 1, 0, "ここで会ったが\n100年目～！", 0, 1.4, "衣之咲 璃乃", 0, 0, 2, 1, "衣之咲璃乃です！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ち、超能力って…\n何のことかな～？", 1, 1012, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1.4, "柏崎 初音", 0, 0, 2, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("一応カリスマ読モJKやってまっす！", 1, 1016, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1.4, "美波 鈴奈", 0, 0, 2, 1, "ちょす！\n美波鈴奈だよ～♪", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("東京は遊園地みたいなところさー", 1, 1017, 1, 0, "でも、沖縄もとってもいいとこさー", 0, 1.4, "喜屋武 香織", 0, 0, 2, 1, "はいたーい。\n喜屋武香織さー。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("先生って呼ばれるのは\nくすぐったいから", 1, 1018, 1, 0, "イオちゃんって呼んでね。", 0, 1.4, "支倉 伊緒", 0, 0, 2, 1, "支倉伊緒です。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あ！/\お兄ちゃ～ん\nまってよ～", 1, 1020, 1, 0, "ミミをおいてかないでぇ～", 0, 1.5, "茜 ミミ", 0, 0, 2, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あの……\nふぇ……", 1, 1021, 1, 0, "ふぇぇぇぇぇん……", 0, 1.5, "栗林 くるみ", 0, 0, 2, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("こんな私に貴重な時間を\n割いていただき、", 1, 1022, 1, 0, "なんてありがとうございます！", 0, 1.4, "風宮 より", 0, 0, 2, 1, "風宮よりです。\nあああああ！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("おにいちゃんどこいくの？\nえ？", 1, 1023, 1, 0, "私こっち行きたいー\nね、早く早くー", 0, 1.5, "北条 綾音", 0, 0, 2, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ふ、不束者ですが\nどうぞ末永く…って、", 1, 1025, 1, 0, "これて何か違う…\nあああすみません！", 0, 1.4, "天野 すずめ", 0, 0, 2, 1, "わっ…わっ…私、\n天野すずめといいます！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あなたは…運命の……\n伴侶……", 1, 1027, 1, 0, "離しませんわ………\n絶対に…!!", 0, 1.4, "倉石 恵理子", 0, 0, 2, 1, "……クスクス…私は\n…倉石恵理子……", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 1028, 1, 0, "…そうでしょ？？", 0, 1.4, "佐々木 咲恋", 0, 0, 2, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ぇっと…\nキミ、私のこと知らないの?!", 1, 1029, 1, 0, "あはは、\n私もまだまだだなぁ～", 0, 1.4, "桜井 望", 0, 0, 2, 1, "桜井望だよ！\nよろしくねっ", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("初めまして、\n私はニノン・ジュベール申すデス！", 1, 1030, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1.4, "ニノン・ジュベール", 0, 0, 2, 1, "デケデケデンっ！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("でもって私の隣にいるのが……\nえ、見えない？", 1, 1031, 1, 0, "おかしいですね……", 0, 1.4, "上喜 しのぶ", 0, 0, 2, 1, "上喜しのぶです。\n手元のドクロが父です。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("けんども\nそれには足りないモンが…", 1, 1033, 1, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, 1.5, "野戸まひる", 0, 0, 2, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ちょっと緊張しちゃって…", 1, 1034, 1, 0, "ちょ\nちょっと一杯飲んできます…！", 0, 1.4, "綾瀬 ゆかり", 0, 0, 2, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("知らない人とは話しちゃいけないので", 1, 1036, 1, 0, "これ以上お話しすることは…\nないです！", 0, 1.5, "氷川 鏡華", 0, 0, 2, 1, "氷川鏡華…です", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("……あ、アラーム。", 1, 1038, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1.4, "柏崎 栞", 0, 0, 2, 1, "柏崎…栞です。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私、一人も友達がいなくて……", 1, 1040, 1, 0, "野に咲く花が、\n唯一の話相手です。", 0, 1.4, "双葉 碧", 0, 0, 2, 1, "ふ、双葉碧です。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 1042, 1, 0, "そう思っています。", 0, 1.4, "三角 千歌", 0, 0, 2, 1, "三角千歌です。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あぁ？\nお前のそいつの仲間か？", 1, 1043, 1, 0, "う、疑ってすまなかったな…", 0, 1.4, "安芸 真琴", 0, 0, 2, 1, "安芸真琴だ。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("生けとし生ける全ての者よ！", 1, 1044, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1.4, "イリヤ・オーンスタイン", 0, 0, 2, 1, "わらわこそは夜を総べる者！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ぐふふふふ……はっ！", 1, 1045, 1, 0, "ｌク、クウカに何かご用ですか!?", 0, 1.4, "遠見 空花", 0, 0, 2, 1, "そこで騎士は妖精を乱暴に……", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 1046, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1.4, "宮坂たまき", 0, 0, 2, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("それでは早速クエストに…", 1, 1048, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1.4, "大神 美冬", 0, 0, 2, 1, "大神美冬よ！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("クエストもバトルも\n掃除も洗濯も", 1, 1049, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1.4, "星野静流", 0, 0, 2, 1, "星野静流だよ！", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("見ての通りの\nセクシー美少女で", 1, 1050, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1.5, "玉泉美咲", 0, 0, 2, 1, "アタシは玉泉美咲。", 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("？？？？", 1, 1052, 1, 0, "？？？？", 0, 1.4, "リマ", 0, 0, 2, 1, "？？？", 0);
